import React from 'react';
import Navbar from './global-components/navbar';
import PageHeader from './global-components/page-header';
import MailLogin from './section-components/mail-login';
import Faq from './section-components/faq-v2';
import Brand from './section-components/brand-v3';
import Subscribe from './section-components/subscribe';
import FooterV2 from './global-components/footer-v1';

const About = () => {
    return <div>
        <Navbar />
        <PageHeader headertitle="AOL Mail Login " />
        <MailLogin />
        <Faq  />
        <Brand  />
        <Subscribe  />
        <FooterV2 />
    </div>
}

export default About
